if (config.demandbase) {
    _satellite.notify('Demandbase | API called');
    /*
      demandbase integration 1/2
      note: 2/2 is located in data element "demandbase"
    */
    window.demandbaseParse = function(dbInfo) {
        if(!dbInfo) return '';
        try {
            window._demandbaseInfo=dbInfo;
            var profile = {};
            // set watch_list default if not returned from DB
            if (typeof dbInfo.watch_list === 'undefined') {
                _satellite.notify('Demandbase | watch list not set',3);
                window._demandbaseInfo.watch_list={'account_status':'[n/a]'};
            }
            for (var key in dbInfo) {
                if (dbInfo.hasOwnProperty(key)) {
                    if (key === "watch_list") {
                        for (var subkey in dbInfo[key]) {
                            if (dbInfo[key].hasOwnProperty(subkey)) {
                                profile['db_watch_list_'+subkey] = dbInfo[key][subkey];
                            }
                        }
                    } else if(key !== "ip") {
                        profile['db_'+key] = dbInfo[key];
                    }
                }
            }
            window.targetPageParamsObj.profile = profile;
        } catch(e) {}
    };
    var dbDomainPath = 'api.company-target.com/api/v2/ip.json';
    var dbVal=_satellite.getVar('demandbase'),
        src='//'+dbDomainPath+'?key='+dbVal.key+'&var=dbInfo&callback='+dbVal.callback+'&query='+dbVal.query;
    document.write(decodeURI("%3Cscript src='"+document.location.protocol+src+"' type='text/javascript'%3E%3C/script%3E"));
} else { _satellite.notify('Demandbase | API call excluded',3); }
